import React from "react";
import ContentFirst from "./ContentFirst";
import ContentSecond from "./ContentSecond";
import ContentThird from "./ContentThird";

import ContentFourth from './ContentFourth';
import ContentFifth from "./ContentFifth";
import ContentSixth from "./ContentSixth";
import ContentSeventh from "./ContentSeventh";


//==============================
const Content=()=>{
    return(
        <div className="content">
            <ContentFirst></ContentFirst>
            <ContentSecond></ContentSecond>
            <ContentThird></ContentThird>
            <ContentFourth></ContentFourth>
            <ContentFifth></ContentFifth>
            <ContentSixth></ContentSixth>
            <ContentSeventh></ContentSeventh>
        </div>
    )
};
export default Content;
